import React, { useStat, useEffect } from 'react';
import axios from 'axios';

function FileUpload() {
    const [selectedFile, setSelectedFile] = useState(null);
    const [dataFrame, setDataFrame] = useState([]); // Initialize as an empty array

    const handleFileSelect = (event) => {
        setSelectedFile(event.target.files[0]);
    }

    const handleUpload = async () => {
        const formData = new FormData();
        formData.append('file', selectedFile);

        try {
            const response = await axios.post('/upload/', formData, {
                headers: {
                    'Content-Type': 'multipart/form-data'
                }
            });
            console.log('Raw response:', response.data); // This should be an array
            console.log('DataFrame state:', dataFrame);

            setDataFrame(response.data); // Assuming the backend returns an array directly

        } catch (error) {
            console.error('Error uploading file:', error);
        }
    };

    return (
        <div>
            <input type="file" onChange={handleFileSelect} />
            <button onClick={handleUpload}>Upload</button>
            <div>
                <table>
                    <tbody>
                        {Array.isArray(dataFrame) && dataFrame.map((row, index) => (
                            <tr key={index}>
                                {Object.entries(row).map(([key, value], idx) => (
                                    <td key={idx}>{`${key}: ${value}`}</td>
                                ))}
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}


export default FileUpload;
